(402, 'ab58fcf1cfd6197c4a44f1b0026f710a', 'en', 'drip_feed_desc', '<p><strong>Drip-Feed</strong> is a service that we are offering so you would be able to put the same order multiple times automatically.</p>\n                        <p>Example: let\'s say you want to get 1000 likes on your Instagram Post but you want to get 100 likes each 30 minutes, you will put:</p>\n                        <ul>\n                          <li>Link: Your Post Link</li>\n                          <li>Quantity: 100 </li>\n                          <li>Runs: 10</li>\n                          <li>Interval: 30</li>\n                        </ul>\n                        <p>\n                          <strong>Note:</strong> Never order more quantity than the maximum which is written on the service name (Quantity x Runs), Example if the service\'s max is 4000, you dont put Quantity: 500 and Run: 10, because total quantity will be 500x10 = 5000 which is bigger than the service max (4000). Also never put the Interval below the actual start time (some services need 60 minutes to start, dont put Interval less than the service start time or it will cause a fail in your order).\n                        </p>'),
